import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../App.css";

import AuthService from "../services/AuthService";

class NavbarComponent extends Component {
  constructor() {
    super();
    this.state = {
      user: "",
    };
  }
  logOut(e) {
    e.preventDefault();
    AuthService.logout();
    window.sessionStorage.clear();
    window.location.reload();
  }

  render() {
    // if (sessionStorage.getItem("user") !== this.state.user) {
    //   // console.log(this.state.user);
    // }
    let user;
    if (sessionStorage.getItem("user")) {
      user = JSON.parse(sessionStorage.getItem("user"));
    }
    return (
      <div>
        <header>
          <nav className="navbar navbar-expand-md navbar-dark bg-personal">
            <div className="container">
              <a href="/" className="navbar-brand mb-0 h1">
                Fleeting Flights
              </a>
              <div className="navbar-nav flex-row">
                {sessionStorage.getItem("user") ? (
                  <ul className="navbar-nav flex-row">
                    <Link className="nav-link" to={`view-customer/${user.id}`}>
                      {/* <img src="/open-iconic/svg/person.svg" /> */} Profile
                    </Link>
                    <button
                      className="btn btn-secondary btn-sm col"
                      onClick={this.logOut}
                    >
                      Log Out
                    </button>
                  </ul>
                ) : (
                  <div className="navbar-nav">
                    <Link to={"/sign-in"} className="nav-link text-right">
                      Sign In
                    </Link>
                  </div>
                )}
              </div>
            </div>
          </nav>
        </header>
      </div>
    );
  }
}

export default NavbarComponent;
